import React from "react";

const Swap = () => {
  return (
    <div
      className="card"
      style={{
        display: "flex",
        flexDirection: "column",
        padding: "15px 15px 13px 15px",
        width: "465px",
        height: "114px",
        marginTop: "191px",
      }}
    >
      <p style={{ marginRight: "auto", fontSize: "20px", fontWeight: 500 }}>
        Swap
      </p>
    </div>
  );
};

export default Swap;
